Рекомендуется обновить устаревшие зависимости в <i>go.mod</i> до последней версии. Отозванные версии игнорируются.
<p>Подробную информацию об отозванных версиях смотрите в описании директивы <a href="https://go.dev/ref/mod#go-mod-file-retract"><code>retract</code> на go.dev</a>.<br/>
Данные о последних версиях предоставляются командой <a href="https://go.dev/ref/mod#go-list-m">go list -m -u</a>.
</p>
